import SharedLayout from './HomePage/SharedLayout';
function App() {
  return (
     <BrowserRouter>
        <Routes>
           <Route path='/' element={<HomePage/>}></Route>
        </Routes>


     </BrowserRouter>
  );
}
export default App;
